import React from "react";
import { FaAngleRight } from "react-icons/fa6";

const GoodName = () => {
  return (
    <>
      <div className="project-div2">
        <div>
          <h2>Good Name</h2>
        </div>
        <div className="goodName-div"></div>

        <div className="project-div2-btn">
          <button>
            Continue <FaAngleRight />
          </button>
        </div>
      </div>
    </>
  );
};

export default GoodName;
